import React, { Component } from 'react';
import Layout from '../Components/Layout'
import Header from '../Components/Header'

class votingInstance extends Component{

    render(){
        return(
            <Layout>
                <Header/>
            </Layout>

        );
    }
}

export default votingInstance;
